import React, { useState } from "react";
import {
  GoogleMap,
  withScriptjs,
  withGoogleMap,
  Marker,
  InfoWindow,
} from "react-google-maps";

function Map() {
  const [selectedLocation, setSelectedLocation] = useState(null);
  return (
    <GoogleMap
      defaultZoom={5}
      defaultCenter={{ lat: 56.94965, lng: 24.105186 }}
    >
      <Marker
        position={{ lat: 56.947123, lng: 24.106816 }}
        onClick={setSelectedLocation(<InfoWindow>Riga</InfoWindow>)}
      />
      {/* {selectedLocation(<InfoWindow>Riga</InfoWindow>)} */}
    </GoogleMap>
  );
}

const WrappedMap = withScriptjs(withGoogleMap(Map));

export default function MapResult() {
  return (
    <div style={{ width: "100%", height: "100%" }}>
      <WrappedMap
        googleMapURL={`https://maps.googleapis.com/maps/api/js?v=3.exp&libraries=geometry,drawing,places&key=${process.env.REACT_APP_GOOGLE_API_KEY}`}
        loadingElement={<div style={{ height: `100%` }} />}
        containerElement={<div style={{ height: `100%` }} />}
        mapElement={<div style={{ height: `100%` }} />}
      />
    </div>
  );
}
